My pull request covers: https://github.com/chaijs/chai-fs definitions. 

My pull request doesn't covers these combinations:
```
expect(path).to.be.a.file(msg).with.contents.that.match(/xyz/, msg);
expect(path).to.be.a.file(msg).and.not.have.contents.that.match(/xyz/, msg);

path.should.be.a.file(msg).with.contents.that.match(/xyz/, msg);
path.should.be.a.file(msg).and.not.have.contents.that.match(/xyz/, msg);
```

Example: 
<img width="600" alt="screenshot 2018-10-04 at 10 06 06" src="https://user-images.githubusercontent.com/2182018/46458254-d15bc980-c7bd-11e8-98bb-a6a38e385fef.png">

@jedmao, @Bartvds, @AGBrown, @olivr70, @mwistrand, @joshuakgoldberg, @shaunluttin, @Naktibalda, @micksatana, @ErikSchierboom

Guys: Do you have an idea how to resolve this issue ?

Allow JSX Elements as added types for title/message properties of the Notification interface. This will allow custom html tags like spans and divs with more control over the notifications' appearance, as is possible in the js module.

For example:
```
notificationSystem.addNotification({
      title: <span data-notify="icon" className="pe-7s-gift" />,
      message: (
        <div>
          Welcome to <b>this app</b> - a great notification demo!
        </div>
      )
    });
```
